  06> REED, Lucy Rachel m on 11.05.1974 to SANDFORD, Ian David
  b 03.04.1952
  b 06.05.1939
  Lucy b. at Gisborne and m. at Hamilton. Ian, slo Kenneth William Sandford (b. 20.08.1911, d.
  19.06.1991, Deputy City Engineer, Hamilton) and Ivy Elizabeth McIlroy (b. 14.10.1914, d.
  03.12.1990). Ian b. at Timaru, Address: 132 Guthries Road, Belfast, Christchurch.
  Lucy attended Queenswood School, Hastings, and Woodford House. She has a BSocSc (Sociology) from
  Waikato University in 1986, BA (Sociology) from Canterbury University in 1987 and Canadian National
  Certificate in Voluntary & Non-Profit Sector Management in 1990. She worked for the Department of
  Social Welfare as a social worker (1974-82) and a senior community adviser (1983-89). She became a
  free-lance management consultant in 1991 and is presently Manager, Programmes at Christchurch
  Women's Prison. Her interests include riding, training and competing in dressage, tramping and
  cycling.
  Ian qualified as a motor mechanic (1970), a registered psychiatric nurse (1986) and a male nurse
  (1970). He has worked as a motor mechanic, psychiatric nurse, social worker and rehabilitation
  officer and is presently managing director of Iron Horse Hobbies (Riccarton). Ian's interests
  include model railways (narrow gauge live steam) and cave exploration. His major achievement has
  been the exploration and mapping of Aurora Cave in Fiordland National Park.
