  Studholme and Diana Mary Lawrence, b. at London, England. Address: "Mataurangi" Station, 1389
  Panikau Road, RD 3, Gisborne.
  Nicholas was educated at Huntley School, Marton, Wanganui Collegiate School and Massey University
  (BAgSc(Hons)). He then worked for Reed Irrigation Systems (1977-80) in Adelaide, Abu Dhabi, Amman
  and Riyadh.
  Anna was educated at St Matthew's School, Masterton and Nga Tawa, Marton. After completing her
  nursing training at Palmerston North in 1977 she worked at Calvary Hospital, Christchurch and
  Wellington Hospital (1977-80). Nicholas and Anna now farm at "Mataurangi" station.
